import React from 'react'
import Birds from './Birds';
import '/Users/CRUD/react-hooks/src/index.css';



const TitleTable = (props) => {
    console.log(props.titles)
    return ( 

       
        
        <table><div className="conti">
            <thead>
            <tr>
                <th>Title</th>
                <th>Company</th>
                <th>Actions</th>
            </tr>
            </thead>
            <tbody>
                {
                    props.titles.length > 0 ?
                    props.titles.map(title => (
                <tr key={title.id}>
                <td>{title.title}</td>
                <td>{title.company}</td>
                <td>
                <button className="button muted-button" onClick={
                    () => {props.editRow(title)}
                    }>Edit</button>
                <button className="button muted-button" onClick={() => {if (window.confirm('Are you sure you wish to delete this item?')) props.deleteTitle(title.id)}}>
                    
                    
                    
                    
                    Delete
                    </button>
                </td>
            </tr>

                 ))   : (
                    <tr>
                    <td colSpan={3}>No Titles</td>
                    </tr>  
                 )
                }
            
            </tbody>
            </div>
        </table>

        

        


     );
}
 


 
export default TitleTable;
